import searchReducer from './searchReducer';
import { combineReducers, Reducer, CombinedState } from 'redux';

const reducers: Reducer<
	CombinedState<{
		search: any;
	}>,
	any
> = combineReducers({
	search: searchReducer,
});

export default reducers;
